    const [buttonid, setbuttonid]=useState(1)
    useEffect(() => {
        axios.get(`https://jsonplaceholder.typicode.com/posts/${buttonid}`)
          .then(res => {
            console.log(res);
            setPosts(res.data);
          })
          
      }, [buttonid])
      function handleClick()
      {
        setbuttonid(id)
      }

      
